import { Grid, Typography } from "@material-ui/core";
import "../css/welcome.css";

const Welcome = (props) => {
  return (
    <Grid
      container
      item
      direction="column"
      // alignItems="center"
      style={{ minHeight: "93vh", 
                fontStyle:"italic", 
                fontFamily:"Sans-serif",
                marginRight:"10px"
              }}

    >
      <Grid item>
        <Typography variant="h2" style={{ textAlign: "center" }}>Welcome to JobHub</Typography>
      </Grid>
    </Grid>
  );
};

export const ErrorPage = (props) => {
  return (
    <Grid
      container
      item
      direction="column"
      alignItems="center"
      justify="center"
      style={{ padding: "30px", minHeight: "93vh" }}
    >
      <Grid item>
        <Typography variant="h2">Error 404</Typography>
      </Grid>
    </Grid>
  );
};

export default Welcome;
